// MainContainer.js
import React, { Component, Img } from 'react';
import App from '../App'
import { Menu, Icon, Layout, Breadcrumb } from 'antd';

import yo from '../imgs/yo.png';
import pete from '../imgs/pete.jpg';

const { Header, Content, Footer, Sider } = Layout;
const SubMenu = Menu.SubMenu;
const MenuItemGroup = Menu.ItemGroup;

class MainContainer extends Component {
  render () {
    let width = 1000;
    let height;

    return (
    <div>
    <Layout>
        <Content className="mainNonNav" style={{ margin: '0px 0px', padding: 24 }}>
          <div style={{width: {width}, height: {height}, background: '#fff', minHeight: 280, paddingRight: 50, paddingLeft: 50, paddingTop: 25}}>
          </div>
        </Content>
    </Layout>
    </div>
    );
  }
}

export default MainContainer;
